import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';

//function App() {
class App extends Component {
  state = {
    values: []
  }

  componentDidMount(){
    axios.get('http://localhost:5000/api/values')
      .then((response) => {
        console.log(response);
        this.setState({
          values: response.data
        })
      })
  }

  render(){
    return ""
  }

}

export default App;
